//add a new vertex to the map
function addVertex(){
	var vertName = prompt("input Vertex Name");
	var faculty = prompt("input Faculty: \nDefault is engineering", "Engineering");
	var locationType = prompt("input type of location, e.g. Building, Junction, Busstop", "Busstop" );
	var coordinates = prompt("input latlong\nlat followed by a comma and space then long");	//copy from google maps or map box
	var latlong = coordinates.split(", ");		//", " to make copying easier

	//add vertex
	vertexArr.push({
		'vertex': vertName,
		'faculty': faculty,		//change as needed for different faculties
		'locationType': locationType,
		'latlongCoordinates': [parseFloat(latlong[0]),parseFloat(latlong[1])],
		'label': 'Infinity', 	//need to reverse censor afterwards
		'roomList': [],
		'edgeList': []
	});
	
	console.log(JSON.stringify(vertexArr[vertexArr.length-1]));
	console.log( "Vertex " + vertName + " added");
}

//edits some attributes of the vertex
function editVertex(){
	var vertName = prompt("input Vertex Name");
	var faculty = prompt("input Faculty: \nDefault is engineering", "Engineering");
	var locationType = prompt("input type of location, e.g. Building, Junction, Busstop", "Busstop" );
	var coordinates = prompt("input latlong\nlat followed by a comma and space then long");	//copy from google maps or map box
	var latlong = coordinates.split(", ");		//", " to make copying easier
	var vertExists = false;
	
	for (v in vertexArr){
		if (vertexArr[v].vertex === vertName){
			vertexArr[v].faculty = faculty;
			vertexArr[v].locationType = locationType;
			vertexArr[v].latlongCoordinates = [parseFloat(latlong[0]),parseFloat(latlong[1])];
			vertExists = true;
			
			console.log(JSON.stringify(vertexArr[v]));
		}
	}

	console.log( "Vertex " + vertName + " edited");
}

//reads the vertex
function readVertex(){
	var vertName = prompt("input Vertex Name");
	var vertExists = false;
	
	for (v in vertexArr){
		if (vertexArr[v].vertex === vertName){
			vertExists = true;
			console.log(JSON.stringify(vertexArr[v]));
		}
	}

	console.log( vertName + " read " + vertExists);
}

//remove a vertex from the map
function removeVertex(){
	var vertName = prompt("input Vertex Name");
	var vertExists = false;
	
	for (v in vertexArr){
		if (vertexArr[v].vertex === vertName){
			vertexArr.splice(v,1);
			vertExists = true;
		}
	}
	
	return (vertName + " removed " + vertExists);
}

